from Type import Type

class Species:
    def __init__(self, name, types, attack, defense, stamina):
        self.name = name
        self.types = types
        self.attack = attack
        self.defense = defense
        self.stamina = stamina

    def __repr__(self):
        return f"Species({repr(self.name)}, {repr(self.types)}, {self.attack}, {self.defense}, {self.stamina})"

